    Matrix buildMatrix(double [][] a) {
        Float64[][] af64 = new Float64[a.length][a.length];

        for (int i=0;i<a.length;i++) {
            for (int j=0;j<a.length;j++) {
                af64[i][j] = Float64.valueOf(a[i][j]);
            }
        }
        return DenseMatrix.valueOf(af64);
    }

    double[][] buildMatrix(Matrix<Float64> a) {
        double[][] ret = new double[a.getNumberOfColumns()][a.getNumberOfColumns()];

        for (int i=0;i<a.getNumberOfColumns();i++) {
            for (int j=0;j<a.getNumberOfColumns();j++) {
                ret[i][j] = a.get(i, j).doubleValue();
            }
        }
        return ret;
    }

