    protected Matrix __invertMatrix(Matrix A) {

        QRDecomposition qr = QRDecomposition.valueOf(Float64Matrix.valueOf(DenseMatrix.valueOf(A)));

        Matrix qinv = qr.getQ();
        // inverse of Q is transposed qinv = qinv.inverse();
        qinv = qinv.transpose();

        Matrix rinv = qr.getR();
        rinv = DenseMatrix.valueOf(rinv).inverse();

        return rinv.times(qinv);
    }

