    public static Jama.Matrix toJama(Matrix _A) {
        double[][] _a = new double[_A.getNumberOfColumns()][_A.getNumberOfRows()];

        for (int i = 0; i < _A.getNumberOfRows(); i++) {
            for (int j = 0; j < _A.getNumberOfColumns(); j++) {
                Float64 f64 = (Float64) _A.get(i, j);
                _a[i][j] = f64.doubleValue();
            }
        }

        return new Jama.Matrix(_a);
    }

    public static Matrix fromJama(Jama.Matrix A) {
        Float64[][] _a = new Float64[A.getColumnDimension()][A.getColumnDimension()];

        for (int i = 0; i < A.getColumnDimension(); i++) {
            for (int j = 0; j < A.getColumnDimension(); j++) {
                Float64 f64 = Float64.valueOf(A.get(i, j));
                _a[i][j] = f64;
            }
        }

        return DenseMatrix.valueOf(_a);
    }
