    static private Jama.Matrix invertDiagonal(Jama.Matrix S) {

        double[][] _s = new double[S.getColumnDimension()][S.getColumnDimension()];
        for (int i = 0; i < S.getColumnDimension(); i++) {
            for (int j = 0; j < S.getColumnDimension(); j++) {
                if (i != j) {
                    _s[i][j] = 0;
                } else {
                    _s[i][j] = 1.0 / S.get(i, i);
                }
            }
        }

        return new Jama.Matrix(_s);
    }
